script: |
  super -f text -I q11097.spq | sort > q11097.out

inputs:
  - name: q11097.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + - ( + - 59 ) NOT BETWEEN ( - CAST ( + ( col1 ) AS INTEGER ) * - col2 - + + col1 * - col2 + - col2 * col0 * col0 ) AND col1;
  - name: tab2

outputs:
  - name: q11097.out
    data: |
      46	51	23
